import Template from "../components/Template";
import swal from "sweetalert2";
import config from "../config";
import axios from "axios";
import { useState, useEffect } from "react";
import Modal from "../components/Modal";

export default function BillSale() {
  const [billSales, setbillSales] = useState([]);
  useEffect(() => {
    FetchData();
  }, []);
  const FetchData = async () => {
    try {
      const res = await axios
        .get(`${config.api_path}/billSale/list`, config.headers())
        .catch((err) => {
          throw err.response.data;
        });
      if (res.data.message === "success") {
        setbillSales(res.data.result);
      }
    } catch (e) {
      showAlertError(e.message);
    }
  };
  const showAlertError = (message) => {
    swal.fire({
      title: "error",
      text: message,
      icon: "error",
    });
  };
  return (
    <>
      <Template>
        <div className="card">
          <div className="card-header d-flex justify-content-between align-items-center bg-success text-white">
            <div className="h4 mb-0">รายงานบิลขาย</div>
          </div>
          <div className="card-body">
            <table className="table table-bordered table-striped table-hover">
              <thead className=" text-center">
                <tr>
                  <th>เลขบิล</th>
                  <th>วันที่</th>
                  <th width="200px"></th>
                </tr>
              </thead>
              <tbody>
                {billSales.length > 9
                  ? billSales.map((item) => (
                      <tr>
                        <td></td>
                      </tr>
                    ))
                  : (
                    <div className="col-12 text-center">ไม่มีรายงานสั่งซื้อ</div>
                  )}
              </tbody>
            </table>
          </div>
        </div>
      </Template>
    </>
  );
}
